// src/components/ResultsComponent.js
import React from 'react';

const ResultsComponent = ({ results }) => {
  if (!results) return null;

  return (
    <div>
      <h2>Analysis Results</h2>
      <pre>{JSON.stringify(results, null, 2)}</pre>
    </div>
  );
};

export default ResultsComponent;
